// Create Sorted Array through Instructions
// Given an integer array instructions, you are asked to create a sorted array from the elements in instructions. You start with an empty container nums. For each element from left to right in instructions, insert it into nums. The cost of each insertion is the minimum of the following:
//
//   The number of elements currently in nums that are strictly less than instructions[i].
//   The number of elements currently in nums that are strictly greater than instructions[i].
//   For example, if inserting element 3 into nums = [1,2,3,5], the cost of insertion is min(2, 1) (elements 1 and 2 are less than 3, element 5 is greater than 3) and nums will become [1,2,3,3,5].
//
//   Return the total cost to insert all elements from instructions into nums. Since the answer may be large, return it modulo 109 + 7
//
// Example
// Input: instructions = [1,3,3,3,2,4,2,1,2]
// Output: 4
// Explanation: Begin with nums = [].
//   Insert 1 with cost min(0, 0) = 0, now nums = [1].
//   Insert 3 with cost min(1, 0) = 0, now nums = [1,3].
//   Insert 3 with cost min(1, 0) = 0, now nums = [1,3,3].
//   Insert 3 with cost min(1, 0) = 0, now nums = [1,3,3,3].
//   Insert 2 with cost min(1, 3) = 1, now nums = [1,2,3,3,3].
//   Insert 4 with cost min(5, 0) = 0, now nums = [1,2,3,3,3,4].
// ​​​​​​​Insert 2 with cost min(1, 4) = 1, now nums = [1,2,2,3,3,3,4].
// ​​​​​​​Insert 1 with cost min(0, 6) = 0, now nums = [1,1,2,2,3,3,3,4].
// ​​​​​​​Insert 2 with cost min(2, 4) = 2, now nums = [1,1,2,2,2,3,3,3,4].
//   The total cost is 0 + 0 + 0 + 0 + 1 + 0 + 1 + 0 + 2 = 4.


/**
 * @param {number[]} instructions
 * @return {number}
 */
var createSortedArray = function(instructions) {

  let nums =[], currentNumber, elementLess, elementGreater, duplicateIndex, sum = 0;
  let memory = {};

  // Create Sorted Array Using Insertion sort
  for(let i=0; i<instructions.length; i++){
    currentNumber = instructions[i];
    console.log('currentNumber is ',currentNumber);
    console.log('i is ',i);
    nums.push(currentNumber);
    for(let j=nums.length-1; j>=0; j--){
      if(currentNumber < nums[j-1]){
        [nums[j], nums[j-1]] = [nums[j-1], nums[j]]
      }
      else{
        console.log('j is ',j);
        elementGreater = i-j;
        duplicateIndex=j;
        if(memory[currentNumber]){
          duplicateIndex=j-memory[currentNumber];
        }

        sum += Math.min(duplicateIndex, elementGreater);
        console.log('duplicateIndex is ',duplicateIndex);
        console.log('elementGreater is ',elementGreater);
        break;
      }
    }
    if(!memory[currentNumber]){
      memory[currentNumber] = 0;
    }
    memory[currentNumber]++;
  }
  return sum%(Math.pow(10,9)+7);
};

